BlocklyGamesMsg["Movie.helpText8"] = "Выкарыстоўвай блок \"калі\", каб намаляваць чырвоны і белы шары для першай частцы фільма. Потым намалюй зялёны шар для другой частцы фільма.";
BlocklyGamesMsg["Movie.helpText9"] = "Можаш перасунуць шар па дроце? Дрот ужо намаляваны. Калі ты зможаш гэта зрабіць — ты зможаш усё.";
BlocklyGamesMsg["Movie.helpText10"] = "Зрабі фільм, які пажадаеш. У цябе з'явілася шмат новых блокаў, якія варта вывучыць. Прыемна правесці час!";
BlocklyGamesMsg["Movie.helpText10Reddit"] = "Выкарыстай кнопку \"Глядзець Галерэю\", каб паглядзець фільмы іншых. Калі ты стварыў нешта цікавае — выкарыстай кнопку \"Захаваць у Галерэі\", каб падзяліцца фільмам з іншымі.";
