BlocklyGamesMsg["Pond.scanTooltip"] = "Шукае ворагаў. Пазнач кірунак (0-360). Вяртае адлегласць да бліжэйшага суперніка ў гэтым кірунку. Вяртае бясконцасць, калі супернік не знойдзены.";
BlocklyGamesMsg["Pond.cannonTooltip"] = "Страляць з гарматы. Пазнач кірунак (0-360) і адлегласць (0-70).";
