BlocklyGamesMsg["Pond.helpUseScan"] = "Тваё рашэнне працуе, але можна зрабіць лепш. Выкарыстоўвай 'scan', каб паказаць адлегласць для стральбы гарматы.";
BlocklyGamesMsg["Pond.helpText1"] = "Выкарыстоўвайце каманду 'cannon', каб ўразіць мэту. Першы параметр — кут, другі — адлегласць. Знайдзіце правільнае спалучэнне.";
BlocklyGamesMsg["Pond.helpText2"] = "Гэтая мэта павінна быць уражаная шмат разоў. Выкарыстоўвай цыкл 'while (true)', каб рабіць нешта бясконца.";
BlocklyGamesMsg["Pond.helpText3a"] = "Гэты супернік рухаецца ўзад-уперад, з-за чаго ў яго цяжка патрапіць. Выраз 'scan' вяртае дакладнае адлегласць да суперніка ў паказаным кірунку.";
BlocklyGamesMsg["Pond.helpText3b"] = "Адлегласць — менавіта тое, што трэба камандзе 'cannon' для дакладнай стральбы.";
BlocklyGamesMsg["Pond.helpText4"] = "Гэты супернік занадта далёка, каб выкарыстоўваць гармату (якая мае абмежаванне 70 метраў). Замест гэтага, выкарыстоўвай каманду 'swim', каб плыць у бок суперніка і ўрэзацца ў яго.";
BlocklyGamesMsg["Pond.helpText5"] = "Гэты супернік таксама занадта далёка, каб выкарыстоўваць гарматы. Але ты занадта слабы, каб выжыць у сутыкненні. Плыві ў бок суперніка, пакуль тваё гарызантальнае становішча менш 50. Затым \"stop\" і выкарыстоўвай гарматы.";
BlocklyGamesMsg["Pond.helpText6"] = "Гэты супернік будзе адыходзіць, калі ў яго патрапілі. Плыві ўперад, калі ён знаходзіцца па-за дыяпазону (70 метраў).";
